import React from "react";
import ICC from "../../Assets/ICC.png";
import UN from "../../Assets/UN.png";

const Partner = () => {
  return (
    <div className="my-24 items-center justify-center flex flex-col">
      <p className="text-[34px] font-semibold">Partners</p>
      <div className="flex flex-col items-center justify-center mt-10">
        <img
          src={ICC}
          alt="partners"
          className=" h-[70px] w-[111px] object-fill border border-[#DBDBDB] p-2"
        />

        <img
          src={UN}
          alt="partners"
          className=" h-[70px] w-[241px] object-fill border border-[#DBDBDB] "
        />
      </div>
    </div>
  );
};

export default Partner;
